/* Nav.css */

.nav {
    display: flex;
    gap: 3rem; /* Adjusted from Tailwind's gap-12 */
  }
  
  .nav-link {
    font-size: 18px;
    text-transform: capitalize;
    text-decoration: none;
    color: inherit;
    transition: all 0.3s ease;
  }
  
  .nav-link:hover {
    color: white;
  }
  
  .nav-link.active {
    color: white;
    border-bottom: 2px solid #6a0dad; /* Purple color for active state */
  }
